        "wakeUpTemperature" : 9, 
        "comments" : "Notre chauffeur habituel nous conduit à la gare de bonne heure et nous voilà une nouvelle en route pour de nouvelle aventures. Nous quittons une fois de plus nos proches et notre zone de confort pour aborder l’amérique latine. Pour une fois le TGV arrive à l’heure à Roissy et nous avons largement le temps d’effectuer les démarches et manger un morceau avant d’embarquer dans le dreamliner de la Norwegian. Après 11 heures de vol nous aterrissons à Oakland. Le passage auprès de l’agent de l’immigration se passe bien, nous lui demandons un mois, il nous en donne 6… On perd presque une heure pour récupérer notre valise en raison d’une panne du systéme et nous pouvons quitter l’aéroport, prendre un taxi et récupérer Thor. Aucune mauvaise odeur, pratiquement pas de poussière ni dégats. Il démarre au quart de tour et nos batterie de service sont pleines. J’ouvre le gaz, le frigo se met en route on peu y aller. La conduite « automatique » revient hyper vite à peine quelques centaines de mètres et on est dans le bain… et dans la circulation très dense. Arrêt au Walmart pour remplir le frigo et route jusqu’à notre point de chute désormais habituel au camping Anthony Chabot. Personne à l’entrée mais nous connaissons notre emplacement habituel qui n’attend que nous. Une fois les branchement réalisé on souffle un peu après ces 24 heures de voyage.\n\nCe matin on se lève sous un très beau soleil. Il fait un peu frais, à peine 9° dans Thor mais le soleil nous réchauffe très vite. Dans la matinée nous faisons une petite balade à pied dans ce park d’eucaliptus qui, même s’il ne fait pas très chaud, dégage une odeur suave qui nous rapelle nos années passées à Ajaccio. On passe la journée à tout ranger et nettoyer. On est fin pret l’aventure peu commencer.", 
