        "comments" : "Nuit très calme au bivouac, deux voiture de police sont stationnes à côté de nous. Je reparts faire quelques photos mais l’accés au bord de baie n’est pas possible en raisons des travaux. Nous quitons Treasure Island et rerentrons dans Frisco en direction des Twin Peaks sous un temps gris et froid. En raison de traveaux je ne peux accéder avec Thor jusqua’au sommet ce qui n’est pas bien grave en raison de la visibilité pas très grande. On poursuit pour voir les Mosaic Steps qui sont des marches d’escalier décorées de mosaïques, elles se trouvent à San Francisco, sur la 16th St au niveau de Moraga St ce qui explique pourquoi elles sont aussi appelées les Moraga Stairs. Il s’agit d’un projet commun des habitants du quartier pour créer de jolies mosaïques sur ces 163 marches. Après un petit tour dans le quartier nous reprenons la route et quittons, à regrets, San Francisco en direction du sud. Nous nous arretons à Los Bagnos, on connait déjà cette ville qui sera notre point de chute pour aujourd’hui. Après quelques courses, nous prenons rdv chez Ford pour le lendemain matin pour la vidange et finissons à la Librairie pour profiter du WIFI et mettre en route mon nouveau jouet.", 
