        "photo" : false, 
        "wakeUpTemperature" : 18, 
        "comments" : "Il a plu toute la nuit mais ce matin, le soleil est bien là. On quitte le bivouac pour le visitor center de la ville et on découvre Palm Springs que nous avons traversé hier sous des trombes d’eau. Ce coin bénéficie d’un micro climat étant protégé pune chaine montagneuse dominée par le mont San Jacinto qui est enneigé, très huppées elle est depuis longtemps le refuge des stars d’holywood et de Vegas ainsi que des hommes politiques. Les Rat pack ont eu des résidences secondaires ici. L’environement est magnifique, des pamiers et des bougainvilliers à la pelle, pas une herbe qui dépasse et de villas magnifiques, a l’architecture très hétéroclite. Bref on s’y sent bien et en plus on trouve vers le musée d’Art moderne des nombreux parking gratuit, ce qui est assez rare pour le souligné. Au visitor center on récupère un plan de la ville ainsi que des billets pour accéder à « Indian Canyons » au prix de 9$/Pers. On traverse la ville et entrons chez les indiens Cahuillas qui sont propriétaires des terres, la réserve d'Agua Caliente. On y passe toute la matinée est enchainons trois trails « Andreas Loop » 1 mile, Puis « Murray Canyon trail et Coffman trail » soit environ 4 miles. On traverse ainsi des zones désertiques très minérales puis de véritables oasis de palmiers le long de ruisseaux qui sont assez gros vu ce qu’il a tombé hier. La plupart des tronc de ces palmiers sont recouverts des palmes séches ce qui leur donne de drôle d’allures. Certains sont recouverts de « Dattes » bien noires et on peut sentir leur odeur d-très sucrées. Mais si le lieu n’est pas de ouf on y passe un bon moment au grand air et c’est pour nous une remise en jambe… En début d’aprè-midi on part pour le centre ville où on arpente l’artère principale North Palm Canyon Drive et son walk of fame sous une température de 20°. La plupart des nom incrits dans les étoiles nous étaient inconnus mais s’y trouve Line Renaud et Catherine Deneuve. Les décos de Noël sont de sorties, on a même vu des voitures décorées et illuminées…\nAvant que la nuite tombe nous regagnons un Walmart Cathédral Spring cette fois-ci.", 
