        "wakeUpTemperature" : 12, 
        "comments" : "Ce matin le temps est magnifique, toutes les montagnes aux alentours bénificent d’une très belle lumière. On part du bivouac, on fait le plein de gasoline et partons pour Joshua Tree National park, en théorie notre dernier grand parc américain. En sortant de la vallée de Palm Springs, on travers un champ d’héoliennes assez impressionnant, plusieurs centaines, de différentes tailles. Nous entrons par l’entrée Ouest qui se trouve dans la ville de Joshua Tree et passons au visitor center récupérer un plan. La ville compte de magnifique Joshua Tree, souvent plus beau et gros que ceux du parc. C’est Samedi et il y a énormément de monde, tous les camping du parc sont Full. Les choses les plus intéressante se touve au Nord du Parc. On peu s’arrêter à « Cholla Cactus Garden » et faire demi tour pour sortie par l’entrée Nord à Twentynine Palms si on à rien à faire au Sud du parc.\nNotre prmier arrêt se fait à «Hidden Valley» où nous faisont un petit trail, une boucle de 1 Mile qui serpente au milieu d’immense rocher, c’est très beau mais il n’ya pratiquement aucun JT. De nombreuses personnes pratiquent l’escalade dans tous le parc. Notre deuxième arrêt se fair à «Barker Dam» également une boucle de 1,3 Miles qui nous conduit à un vieux barrage fait par les gens de « Key Ranch » Le petit lac formé par la retenue est très beau. Le décor en général est à voir. Nous poursuivons vers le Sud et allons jusqu’à «Keys Views» point de vue a 1581 mètres qui offre une vue panoramique de la vallée et montagnes environnantes de Seaton Sea à Palm Springs. On peut également voir la faille de San Andrea qui passe dans la vallée. En début d’après midi on fait un trail à « Skull Rock » pour finir notre visite à « Cholla Cactus Garden » véritable champs de ce type de cactus très beau surtout au couchant. A partir de ce point il n’ y a plus rien d’extraordianire jusqu’à la sortie Sud du parc. Nous nous posons juste à la sortie dans un BLM où sont présents de nombreux campeurs.", 
