        "wakeUpTemperature" : 11, 
        "comments" : "Départ en direction de Salvation Mountain. La route que nous voulions prendre est fermée en raison des fortes pluies et nous devons faire un détour par Indio ce qui nous rallonge pas mal. Salvation Mountain encore un lieu spécial réalisé par Leonard Knight qui a commencé son oeuvre en 1984 pour la finir vers 1994. Devant la panneau du site un motard avec une 1200 GS flambant neuve me demande de le prendre en photo. Il est équipé de la tête au pied en équipement BMW, même la casquette. Nous discutons un long moment voyage et donne plein de tuyau sur la Basse californie en nous disant de prendre notre temps car c’est magnifique. Il parle le même anglais que moi, on se comprend très bien… Au delà de ce monument se trouve Slab City, un coin de desert où se sont installés une communauté de style Hippies qui vivent là en marge de la société. Un séquence du film « Into the Wild » y a été tournée. Nous nous installons là, au milieu de rien, aucune règle, aucune commoditée.\nComme nos pièces ne sont pas toutes arrivées chez le concessionnaire, nous décidons de rester un peu là pour ne par s’enfermer directement dans San Diego.", 
