        "photo" : false, 
        "wakeUpTemperature" : 9, 
        "comments" : "Ce matin départ de bonne heure de notre bivouac pour arriver à l’heures à notre rendez-vous chez un concessionnaire de RV à El Cajon avec qui nous sommes en contact, avec mon fils, depuis plusieurs mois pour commander des pièces. Je ne sais pas si c’est la fait que l’économie américaine est en forme mais ce n’est pas aisé de faire affaire avec eux. Nous rencontrons enfin Bryan qui nous prend rapidement en charge. On liste les travaux à réaliser et puis nous allons nous installer dans leur « lounge » avec tout le confort. 3 heures plus tard Brian revient en me disant qu’il y a un problème. En effet la bâche du store que j’ai commandé a bien été montée mais deux gros trous sont visibles… Après quelques tergiversations et quelques coup de fil il m’en trouve une qui devrait être là dans 2 ou 3 jours… On repart malgrè tout avec un mirroir de rétrovieur neuf, mon feu de recul arrangé et le chauffe-eau réglè, ce n’est pas si mal…\nOn fait un arrêt au visitor centrer de la ville puis nous essayons de nous garer près du centre historique mais on ne trouve pas de place pour Thor. Comme in est déjà tard, 15h00 … nous allons faire quelques courses au Walmat puis nous nous mettons en quête d’un bivouac pour la nuit. Pas chose facile en ville, finalement nous trouvons un coin près de sea world. Il est 17h00 est la nuit est tombée…", 
