        "wakeUpTemperature" : 13, 
        "comments" : "Ce matin nous partons en direction de la vieille ville de San Diego qui a été entièrement conservé et restauré. On y retrouve les ancien batiment officiels et commerces autour d’une grande Plaza de las Armas. Il y a surtout de nombreuses boutiques de souvenirs arrivées tout droit du mexique. Toutefois nous sommes rentrés dans un Tabac / Fumoir (Racine & Laramie Tobacconist) qui pour une fois aurait pu être un vrai. Le monsieur était habillé en costume d’époque, le chapeau, la belle moustache, le tout dans un décors chargés aux fortes odeurs de tabac froid mais un peu sucré comme si de l’amsterdamer y avait été consommé récement. Il s’agit aussi bien d’un lieu où l’on peu acheté mais également un musée avec un grand nombre d’objets, pipes en tout genre, boite à cigarettes, cigares….  Les restaurants comme « Fiesta Del Reyes » sont vraiment très colorés et décorés avec en plus pour l’occasion les décos de Noël.\nNous partons en suite nous stationner près du stade de baseball « Petco Park » pour visiter le centre ville actuel, Historic Gaslamp Quarter, Horton Plaza park, Littles Italie, l’Embarcardero et Seaport Village. La ville n’a rien d’exceptionnel en soi  mais elle est somme toute bien agréable. Ce qui est impressionnant c’est aéroport qui se trouve au fond de la bay et le couloir aérien qui survole le centre ville. Les avions volent très bas et l’architecture c’est adaptée aux passages des avions de ligne. San Diego est la ville de la trotinnette, électrique ou pas. Il ya en a de partout à disposition des habitants. Elle sont toutes géolocalisées sur une application et il suffit d’1 dollar pour demarrer. Par contre je n’ai pas compris comment s’effectuée la recharge car contrairement aux vélos, elles se laissent n’importe où. On a vu de nombreux « Sapins de Noêl » composés de dizaines de pots de « Roses de Noël » empilés sur une armature métallique, c’est très original.\nSan diégo c’est surtout un ville qui troune autour de Navale et l’aéro navale. Si l’USS Midway est à quai, transformé en musée, on voit au loin, sur l’ile de Coronado, les silhouettes imposantes de plusieurs porte avion eu autres batiments toujours en service. De retour à Thor nous repartons vers le nord de la ville pour trouver un bivouac au bord de la Baie. Dans la journée on reçoit un email du concessionnaire qui nous indique que le store de nesa pas là avant le 19, du coup on va trainer un peu ici et certainement remonter vers LA, comme dit Jhonny « I want Back to LA).", 
