        "comments" : "Ce matin nous quittons notre bivouac pour promenner le long du Pacifique. Premier arrêt au village de la Jolla où nous premenons le long de l’océan de la Jolla Cove à Children’s Pool La jolla, où l’on peut observer plusieurs colonies de « Sea Lions » et d’oiseaux.\nnous poursuivons vers le sud jusqu’à la péninsule de Point Loma pour visiter le « Parc Cabrillo National Monument », la pointe est pratiquement toute occupée par l’armée. Un peu avant d’arriver, un panneau nous informe qu’en raison du « Shutdown » le site est fermé. Nous allons quand même jusqu’à l’entrée du site, ce qui nous permet de bénficier d’une superbe vue sur Coronado et San Diego et ainsi de faire un tour au cimetière militaire « Fort Rosecrans National Cemetery », toujours impressionnant de voir la façon avec laquelle on respecte et considère les vétérans ici. Sur de nombreuses pierres tombales sont apposé une couronne pour les fêtes de fin d’année.\nComme notre dernière visite est annulé, nous décidons de regagner notre bivouac à Mission Bay pour passer le reste de l’après-midi à profiter du soleil et de la baie.\nEn fin d’après-midi un français vient taper à notrre porte, il s’agit de François, un couple qui vient d’arriver à San Diego à bord d’un camping-car français sur porteur Fiat. Nous faisons, peu après, connaissance de Yumie son épouse. A la bonne heure je tape à la porte de chez eux et les invite à venir passer un moment avec nous. Nous passons une bonne partie de la soirée à discuter autour d’un apéro et fromages que François a amené. Très agréable soirée.", 
