        "photo" : false, 
        "wakeUpTemperature" : 0, 
        "comments" : "Ce matin on profite de cette belle journée our trainer un peu au bivouac. En début d’après midi nous allons faire quelques courses pour Noël, je m’achète deux paires de chaussure de marche, j’en suis à quatrième depuis le debut du voyage ainsi queque truc obligatoire en AmSud pour Thor, une sangle de remorquage, des gilets… jaunes. En fin d’après midi on se pose sur la 5th avenue au centre ville de San Diego. Le centre ville est très animé, il y a beaucoup de monde en ce soir du réveillon, nous sommes surpris. Les illumination sont sympa, beaucoup de monde dans restaurants. Il faut dire qu’ici à partir de 17h00 les gens commencent à ce restaurer. Nous choisissons un SteakHouse, le Greystone Prime qui à l’air très sympa, en fait il ressemble à un restaurant tel que nous l’entendons, très belle décoration, des nappes et serviettes en tissus, de beau verres, des serveurs habillé pantalon noir, chemise blanche et tablier. Ils porposent tout plein de style de viandes affinées 21 jours provenant des USA, du Japon et d’Australie. C’est un pur régal, la viande à un gout particulier et d’une très grande tendreté. On se choisi un vin rouge argentin excellent et nous passons une super reveillon  en tête à tête et… à l’américaine.\nEn sortant nous nous rendons dans un bar clandestin, héritage de l’époque de la prohibition dans les années 20, il se trouve sur la 5th au 548, une simple porte en fer dans un renfoncement dont les inscription laissent à penser qu’il s’agit d’un cabinet d’avocat. Il faut attendre devant qu’une personne vous introduise. On voit arriver un black immense, une vrai armoire à glace avec une cravatte à Leds. Il s’approche de nous, nous regarde  est dit « Are you ready ? » of course… Il appuie sur un bouton dérobé, on entant un clic et la porte s’entrouve laissant apparaître un escalier. On arrive dans une cave toute en longueur abritant un bar et une salle. Ce soir pas de live music mais un DJ habillé dans un costume de noël rouge avec des décos et des pantoufles en léopard !!! On se boit un coktail en écoutant de la bonne musique avant de retourner à notre bivouac. ", 
