        "wakeUpTemperature" : 10, 
        "comments" : "Ce matin nous partons pour notre rendez-vous à La Mesa RV à El Cajon. A notre arrivée Ryan nous prend en compte rapidement et le travaux commencent. Vers 13h00 il nous indique que la tête du store compte deux partie et qu’il n’a commandé que la façade extérieure… Heureusement dans la magasin il y a un store de présenté de la même marque que le notre. On lui montre et bingo c’est le même. On rerpart vers 14h00 après avoir fait le plein d’eau, tout est ok. Enfin… On se rend dans une agence Progressive pour faire stopper notre assurance mais il s’agit en fait que d’un bureau pour les sinistre. L’agent nous indique qu’il faut tout faire par téléphone. Au bout du fil la personne qu’elle peut me rembourser via la CB que j’ai utilisé pour payer ma cotisation, le problème c’est que j’ai changé de CB depuis, au final elle envoit un chèque chez notre fils et après on s’arrangera.. On retraverse la ville pour nous rendre à l’agence de la «Baja Bound Mexican Insurance» où je prend une assurance pour le mexique et pour un an. On passe au walmart faire quelques courses puis plein de gazoline… Journée bien remplie, on fini la soirée au bivouac, dans Thor, devant un apéro avec François et Yumie.", 
