        "wakeUpTemperature" : 5, 
        "comments" : "Ce matin nous décollons de bonne heure, pour être à l’ouverture de la laverie afin de partir au Mexique à nour de tout. En route nous faisons les dumps et après la laverie on passe à la Bank Of America pour retirer des dollars pour avoir au cas ou.\nNous faisons le choix de ne pas passer au Mexique par Tijuana mais par Tecate qui est un petit poste frontière moins fréquenté et où on aura plus le temps pour faire les papiers. C’est à moin de 1 heure de route de San diego, on traverse un petite chaine de montagne, la route est agréable. C’est un peu le silence dans Thor, on quitte les USA, non sans , on a le blues… Nous avons passée une année formidable.\nOn arive à Tecata, du côté entrant de la frontière. On aperçoit Fabrice et Yumie en pleine démarches administratives. On s’avance, une agent nous pose quelques questions, jette un oeil rapide dans Thor et ouvre juste un placard et nous laisse passer. On pourrait sans tenir là car la Basse Californie à un statue un peu paticulier. Comme nous voulons ensuite quitter cette péninsule pour accéder au «continent» nous préferons faire tous les papiers ici plutôt qu’à La Paz.\nOn passe côté Mexicain et trouve une place pour Thor, Corinne reste à l’intérieur et je reparts au poste frontière. La procédure complète est expliquée ici.\nUne fois en règle, tampons et taxes acquittés Thor peu rester 10 ans sur le sol Mexicain et nous 180 jours renouvelables. Je m’arrête dans une banque retirer des Pesos méxicain, qui s’apelle aussi dollars mexicain et dont le sigle est «  $ ». Les premiers prix que l’on voit affichés nous font sursauter avant que l’on réalise qu’il s’agit de pesos. Actuelement le change est de 21 $ pour 1€.\nNous quittons ensuite la ville direction Ensenada, notre direction du jour et bivouac pour la nuit. Cette route est « La ruta del Vino » il y a en effet de nombreuses caves à vins et des vignobles sur les coteaux.\nNous arrivons en ville et nous nous occupons en priorité des courses. Nous avions fait en sorte de n’avoir aucun produit frais dans le cas où nous passions un contrôle sanitaire, mais rien de tout cela. Histoire de faire une transiotion en douceur nous allons dans un Walmart… Nous trouvons de Nopal, feuille de cactus que nous avions déjà gouté lors de notre derier voyage au Mexique chez nos amis Felx et Nathalie. On demande à une personne comment les préparer au mieux et plusieurs personnes se mêllent à la conversation. Donc se sera blanchi ou poellé… En ville nous croisons une renault Kadjar et une peugeot 3008.\nOn trouve notre bivouac, Fabrice et Yumie sont déjà arrivés, on se gar et nous partons faire une tour en ville. En passant sur le malecon, on tombe sur un grand marché, certainements pour les fêtes, produits artisanaux, nourritures, animations, l’ambiance est très sympa. On reste un bon moment à regarder un spectacle de clowns, on ne capte pas tout mais on rigole quand même bien. \nEn fin d’après-midi on fait retour au bivouac, nous avons passé notre première journée au Mexique.\n", 
