    "_id" : "5c296cbe2a59fd0245742877", 
    "fromDateTime" : "2018-12-30T00:00:00.000+0000", 
    "toDateTime" : "2018-12-30T00:00:00.000+0000", 
    "weather" : "Ensoleillé", 
