        "walk" : 5100, 
        "photo" : false, 
        "wakeUpTemperature" : 12, 
        "comments" : "Nuit très calme au bivouac. On rencontre nos voisins, un van et un très vieux RV dont les occupants sont américains.\nCe matin nous partons visiter la ville en commençant par la Cathédrale de nustra senora de Guadalupe qui est très belle etoù pirent de nombreuses personnes, cela change… Autour nous trouvons et boulangerie « Panaderia » où e pain ressemble à nos baguettes même s’il est dit qu’il sagit de pain Italien. Nous rentrons et prenons une baguette et deux gâteaux, c’est dimanche…. On commence à discuter et on fini par visiter l’atelier avec ces machines datant de 1919 achetée d’occasion en allemagne. Le four est en pierre, il nous ouvre la porte pour voir la cuisson du pain. Super accueil, les gens sont vraiment sympatiques.\nNous poursuivons non loin de là par le centre culturel qui abrite un jardin, des salls de fêtes un musée et quelques petites boutiques.\nA midi Corinne prépare le Nopal que nous avons acheté au Walmart, ce n’est pas extraordianire mais cela fait toujours plaisir de goûter autre chose.\nOn poursuit notre visite de la ville par monter sur la coline «Chapultepec» qui domine la baie et la ville. Au haut il n’y a pas de Parking mais un garde de l’entrée d’une résidence privée nous trouve une place pour quelques instant le temps de prendre quelques photos.\nRetour en ville où nous nous arrêtons dans un TelCel qui est l’opérateur de téléphonie Mobile Mexicain. On prend une carte prépayée pour pourvoir téléphoner au mexique (8,90$/mois voix et SMS illimités, 4 Go pour internet, réseaux sociaux en illimité).\nOn fini les dépenses par faire le plein de gazonline (19,54 $ soit 0,87$) et passer au Walmart acheter des bouteilles d’eau car ici on ne pourra pas remplir notre réservoir avec de l’eau potable. Finalement il fait presque nuit quand nous avons fini, trop tard pour quitter la ville, on retroune à notre bivouac. C’est vraiment une gros changement avec les USA, circuler en ville n’est pas aisé tans leur signalisation est anarchique. A chaque carrefour, sa signalisation, parfois 4 «Alto» ou bien seulement deux ou bien encore un feu rouge à moitiè déglingué et pas forcément visible, tout en évitant les trous et en faisant attention aux bump, c’est du sport. \n On passe la soirée avec François et Yumie qui sont restés ici une journée de plus comme nous. Super journée.", 
