        "comments" : "Nuit très calme au bivouac mais assez fraiche, le chauffage c’est déclenché ce matin vers 6h00, donc moins de 5° dans Thor.\nNous prenons la route de bonne heure en direction de la ner de Cortez et plus précisément Bahia de Los Angeles.\nNous traverssons donc toute la péninsule d’Ouest en Est par la Ruta 1 qui parfois très belle, parfois très mauvaise et souvent trouée, toujours très étroite…\nNous faisons une halte à El Rosario, un petit village où nous faisons quelques courses pui le plein de l’essence. Le gar qui me sert sort en chachette de sa combinaison un gros fosille de amenite et demande tout doucement si je suis intéressé. Je luis demande combien et il m’annonce 1500 pesos, je laisse tomber. Cette région est effectivement connue pour ces fossiles.\nAu centre nous traversons une zone vraiment très belle avec de gros cactus de toutes sortes au milieu d’une décor minéral de gros monilte.\nNous arrivons à Bahia en début d’après-midi on en fait rapidement le tour à la recherche de François et Yumie mais en vain. IL faut dire que nous n’avons aucun réseau depuis nore depart ce matin, aussi bien avec AT&T que Telcel. Au final on nous indique une épicerie qui vend du Wi-Fi et contre 15$M on a droit à 1 heures de Wifi.\nAprès retour au camping dont les places sont sur la plage face à la mer de Cortes, c’est magniqique.", 
