        "wakeUpTemperature" : 10, 
        "comments" : "Vue magnifique ce matin sur la mer de Cortes. On prend notre temps, On prend une douche pas chaude mais pas glacée au camping, nous faisons une longue balade sur la plage, nous sommes seul au monde, les montagnes aux alentours ont une très belle couleur bleutée.… \nAvant de parti à midi nous faisons les dump et nous partons en direct de la ville. Nous tombons sur Francois et Yumie arrivent juste en ville et sont en train de faire le plein d’eau. Nous mangeons ensemble un très bon repas au restaurant « Las Hamacas » des ensiladas au poulet accompagnes de riz et de purée de haricots rouges, et pour les hommes « Combinaisons Mexicaine » 4 specialités différentes avec du riz. Nous partons ensuite à pied en quête d’une panadéria mais en vain puis nous nous arrêtons à une épicerie faire quelques courses puis reprenons nos véhicule direction « La Gringa » un spot sauvage au nord de la ville au bord d’une lagune.\nCette zone est connue pour pouvoir faire la rencontre de requin baleines, nousnous arrêtons en route auprès d’un magasin de plongée mais les responsable nous indique que c’est uniquement de Mai à Novembre, tampis, on se rattrapera sur les baleines…\nUne fois sur place on se fait doubler par un américain dans un gros 4x4 ford hyper long « Grande Ford » qui nous demande si nous savons ou aller et il nous indique un spot où le sol est un peu dur pour les RV.\nNous faisons ensuite une très belle balade sur la plage de petit galet et en route nous tombons sur des centaines d’étoiles de mer plus ou moins rouge, échouée ? \nNous passons la soirée dans Thor avec François et Yumie pour un apéro amélioré pour fêter la nouvelle année.\nEn sortant la nuit est particulèrment belle et étoilée et je sors le matériel pour faire quelques photos denuite et de la voie lactée.", 
