        "comments" : "La nuit a été rythmée par les cris des Coyotes, ils devaient être une sacré meute, c’est vraiment cool.\nCe matin levé de bonne heure pour un Timelaps du levé de soleil, résultat pas terrible… On observe une chasse de dauphins au large.\nAprès le petit déjeuné départ pour une balade au bout de la lagune, la vue sur l’isme est vraiment très belle. Puis retour à Thor, Corinne passe le reste de la matinée a essayé de me couper les cheveux, c’est vraiment pas facile puis je me taille la barbe.\nAprès une sieste bien méritée je pars faire quelques photos peu avant le couché de soleil de la plage, La Gringa et Thor. On fini l’après-midi à travailler un peu l’Espagnol puis à 18H00 nous nous rendons chez François et Yumie pour passer une excellente soirée en leur compagnie.", 
