        "wakeUpTemperature" : 12, 
        "comments" : "Nuit calme sans coyote…\nCe matin le temps est gris. On part faire une balade avec Fraonçois et Yumie dans le dersert puis le long de la côte très sauvage. Super balade.\nA midi on prend les camping-cars pour se rendre à la «Ville» Bahia où nous testons un autre resto, le «China Place». Nous prenons plusieurs Tacos, poisson en beigné (pescado), crevettes en beigné (Camaron), viandes (Asada), viande et fromage (Quesatacos) et Adobad, une sorte de viande marinée. Sur le comptoir de nombreuses sauces pour accompagné, dont une extrémenent forte pour nous. Pour boire il faut acheté sa bière à l’épicerie d’à côté. La cuisinière prépare tout cela devant vous sur une plancha. C’est très bon pour un prix de 25 à 30 pesos pièce…\nNous passons le reste de l’après-midi à l’épicerie où nous prenons du Wifi afin de pourvoir communiquer avec la famille, on appelle Alexandre et apprenons que ma mère est hospitalisée depuis deux jours… Je traite les photos et les envoie sur Flickr, je suis à jour.\nVers 17H00 la nuit tombe et nous rentrons au bivouac à La Gringa, on croise un petit coyote, quelques gouttes commencent à tomber…", 
