        "distance" : 50993, 
        "distanceTrack" : 0, 
        "walk" : 0, 
        "photo" : false, 
        "wakeUpTemperature" : 16, 
        "comments" : "Cette nuit nous sommes réveillés en sursaut vers 03h00 du matin par une meute de coyotes qui c’est mise à japper, ils devaient être juste derrière Thor, certainement à la recherches d’hypothètiques restes. Ce matin on se lève avec un temps toujours gris, il a un peu plu cette nuit.\nCe matin nous faisons une halte dans un épicerie à Bahia pour acheter du temps WiFi, je tente d’appeler tout le monde par messenger mais personne ne décroche. Nous prenons la route jusqu’à Guerrero Negro, nous traversons de très beaux désert avec une grande diversité d’arbres et cactus, dont certain que nous voyons pour la première fois, un grand tronc en forme conique parfois très haut avec de petites branches très courtes le long du tronc, au sommet des fleurs en forme de plumeau de couleur jaune. On croise pas mal d’animaux en liberté au bord de la route, chevaux, vaches et anes mais aussi des carcasses au bort de la route ce qui fait ventre de nombreux Uburu à tête rouge. \nSur la route nous passons deux check point des militaires qui nous laisse passer rapidement, au dernier contrôle, sur l’autre voie il semble y avoir un problème avec un conducteur, le chien passe une peu partout. Peu après le passage de la « frontière » avec la Basse-Californie du Sud, nous passons un contrôle sanitaire, l’agent nous demande juste 20$Mex et nous demande d’avancer, il déclenche alors des jets sous la caisse de Thor pour le désinfecter… Nous changeons également de fuseau horaire, nous ne sommes plus qu’à -8 heures par rapport à la France.\nArrivé à Guerrero Negro on retrouve du signal avec Telcel et non AT&T et je peux enfin recevoir mon courrier et avoir des nouvelles de ma mère. Nous faisons des courses, surtout du frais, car en raison du contrôle sanitaire nous avions fait en sorte de ne pas avoir de fruit et légume, et de la viande, on commence tout doucement à explorer les rayons des produits mexicains. Nous nous arrêtons ensuite dans une Panaderia pour trouver du « pain » mais ils n’ont plus grand chose en stock, nous prenons deux petites boules et un genre de sablé.\nOn quitte le centre ville pour notre bivouac du soir, un vieux phare abandonné, qui se trouve en pleine baie, le long d’une longue piste/Digue de 12 Km. En route nous rencontrons un balbusar pêcheur, posé sur un panneau en train de déguster un poisson qu’il tient fermement entre ces serres. Nullement pertubé par notre arrivé, il continu son festin tranquillement. Arrivé au phare on profite du couché de soleil sur la baie, nous sommes rejoints par François et Yumie. Seuls quelques pêcheurs vivent là dans des conditions très spatiates je vais les voir pour leur demander si nous pouvons rester là pour la nuit, c’est OK pour eux. A côté de nous se trouvent également 3 jeunes allemands de Berlin qui voyagent dans un van.", 
