        "comments" : "Nuit très calme. Ce matin le beau temps est au rendez-vous. Je discute avec un couple qui est arrivé hier soir au bivouac en moto Suzuki 650, une québécoise et un autralien qui compte aller jusqu’à hushiuia.\nNous quittons le vieux phare pour Guerrero Negro car nous devons faire tous les pleins. Par la piste nous traverssons à nouveau la lagune sur cette digue qui nous permet de très nombreuses sortes d’oiseaux.\nIci pas d’eau potable courante, le gens doivent se rendre dans des ateliers de purification qui vend l’eau potable. Les gens apportent leur Garafon gros bidons type distributeur d’eau pour le faire remplir.\nNous nous garons devant le magasin qui est très propre et les employés très pécautionneux. Il me passe une tuyau que je branche au réservoir. On fait le plein, une quarantaine de gallons soit 120 litres pour 70 $Mex soit eviron 3€.\nOn passe ensuite au propane qui est bien moins cher qu’aux USA, 12 $Mex/litres puis l’essence qui est à 19,10 $Mex/litre soit moins d’un euro.\nOn fini par les courses, on trouve un grand magasin où l’on trouve tout ce dont on a besoin, quand on ne connait pas on demande, les gens sont très gentils et serviables avec nous. On passe dans une panaderia pour acheter du pain, enfin rien à voir avec le notre et on se rend dans un restaurant  où on retrouve François et Yumie. On mange très bien, poissons pour moi et un genre d’escaloppes milanaises pour Corinne. En guise d’entrée ils nous apportent un petit bol de soupe de verdure, aux épinards, très bon.\nAprès le repas, nous faisons route vers notre destination du jour « Ojo de Liebre » une lagune où nous espérons voir des baleines grises demain. On quitte rapidement la « 1 » pour prendre une piste assez belle sur 25 km. En route nous traversons une sorte de marée salant. Arrivé sur place nous payons notre emplacement pour la nuit, 100 $Mex et nous nous installons. Nous finissons la journée par une petite marche qui nous mène sur un ponton d’où les bateaux partent le matin à la recherche des cetacés. La nuit n’est pas encore tombée que nous entendons déjà des coyotes, la nuit risque d’être bruyante. Nous assistons à un très joli couché de soleil où le ciel s’embrase.", 
