        "wakeUpTemperature" : 16, 
        "comments" : "Nuit très calme, aucun coyote n’est venu nous réveiller. A 8hoo nous sommes devant le guichet pour prendre nos places pour faire un tour de bateau à la recherche des baleines. La dame nous explique qu’il vut mieux prendre le premier tour de bateau car le soleil rasant permet de repérer plus facilement les cétécés Nous payons 850$Mex/Pers. François tente de négocier un deuxième tour à un prix réduit mais reine à faire…\nNous montons à 4 dans un petit bateau piloté par Luis Senior.\nNous faisons en grand tour dans la baie de plus de 2 heures où nous avons pu observer des baleines, male et des femelles avec de petit baleinaux. Nous avons également été escorté un bon moment par un dauphin. Nous sommes en début de saison et elle sont encore un peu farouches et les baleinaux trop petit pour se laisser approcher. Matinée magique.\nJe branche mon ordinateur dans la salle du restaurant et je traite toutes mes photos. Trois coyotes s’approchent assez près du visitor center ils sont magnifiques.\nEn fin d’après-midi on repart au fond du camping au niveau du chenal pour la nuit.", 
