        "comments" : "Cette nuit il a tombé quelques goutes et le temps est couvert ce matin, Nous passons la matinée à Ojo de Liebre, on profite de pouvoir se brancher pour traiter photos et video. J epasse un long moment au niveau de l’escalier en bois qui monte au toilette homme, seul endroit où l’on capte un peu, pour prendre des nouvelles de la famille.\nAprès midi nous prenon la route pour passer la nuit près d’un salar. Je trouve une piste qui passe sur les digues et qui tombe directement sur le point. On voit bien un grand panneau qui dit en gros propriété de l’Etat Fédéral ne pas entrer, mais en tente quand même le coup. A pein un kilomètre après le panneau on tombe sur un garde dans sa guitoune qui nous fait faire demi tour, selon lui la route est coupée. On reprend la Ruta 1 et contournons la Lagune par le sud pour accéder au Salar où nous passons la nuit.", 
