        "comments" : "nuit très calme au bivouac, le soleil se lève sous un épas brouillard, décidement les déserts nous réservent toujours des reprises. Nous décidon finalement de ne pas continuer vers Bahia de Tortuga et préférons partir plein Est vers le villade de Saint Ingnacio. La route traverse la réserve de la biosphère de Vizcaino, le décor est très beau et c’est plutôt inattendu de voir des grands seguaros sous le brouillard. Le temps se lève peu à peu et nous arrivons à destination sous un beau soleil. Nous nous garons sur la place centrale juste devant la Misión San Ignacio Kadakaamán, troujours en activité, non loin se trouve un petit musée de la région, nous y voyons notemment des représentations de peinture ruprestres très présentes dans la région. Ce village est un véritable oasis avec un beau lac entouré de palmier datiers qui’ils exploitent. Nous achetons dailleurs des patisseries très bonne faite à partir de ce fruit. A midi nous mangeons dans un petit restaurant, pour Corinne et Combinacion mexicana pour mois, un petit assortiment des spécialités locales dont un poivron farcie avec du fromage puis pané et servie avec une sauce tomate, très très bon.\nEn debut d’après-midi nous croisons François et Yumie qui arrivent de Guerro Negro. Quant à nous nous partons vers la lagune San Ingnacio pour un camping mais la piste est vraiment trop mauvaise pour Thor et nous décidons de faire demi-tour.\nDe retour à au village nous allons visiter la « Casa Nereé » un très belle maison tenue par des américains qui ont transformé cette maison construite par un imigrant Français en bibliothèque/musée sur la ville et sa région et qui vous fais visiter toute sa maison et sont très beau jardin. \nNous finisson la journée au bord du lac avant de rejoindre François et Yumie  sur la parking de l’hôtel La Huerta, qui comme souvent ici, accueille les RV moyennant quelques pesos. On fini dans Thor devant un petit apéro et spécialités locales.", 
