        "walk" : 4000, 
        "photo" : false, 
        "wakeUpTemperature" : 16, 
        "comments" : "Nuit difficile, François et Yumie ont été inspirés de lever le camp pour un bivouac plus sauvage. Le vendredi soir et même la nuit sont très agités et bruyantes à Sant Rosalia.\nCe matin nous passons à la panaderia pour prendre quelques gâteaux et une baguette puis nous levons le camp.\nNous arrivons à Mulegé en milieu de matinée, nous allons directement à la Mission de Santa Rosalia de Mulége. Nous y retrouvons François et Yumie. Très belle mission qui est encore active. Elle a été contruite un peu comme un fortin au sommet d’une coline qui domine le fleuve et une immense palmeraie, c’est un véritable oasis, on comprend pourquoi les moines ont choisis ce lieu, on se croirait un peu dans l’atlas. Avec François on entend de la musique et des chants au loin, on décide d’aller voir et on tombe près d’une maison où une vingtaine de personne chantent sur une bande son, certainement une messe mais de quelle obédiences ???, on repart sans le déranger.\nNous mangeons sur place et goutons la fameuse baguette qui est en fait un genre de sandwich avec du fromage certainement du chorizo et d’autres choses, ce n’est pas mauvais même si un peu fort, mon gâteau ressemble un peu à un cheesecake et le donutau choculat de Corinne a un peu le goût de la muscade. Nous dégageons un peu vite car la mission est ouverte et les croyants arrivent pour la messe du dimanche qui se déroule à 12h30. Nous quittons la mission pour le centre ville qui commence par une immense porte. Ona repéré un bivouac près du phare qui se situe à l’embouchure du fleuve mais les deux routes qui y donnent accés sont barrées par de policiers municipaux, on ne peut pas entre en ville, comme c’est dimanche, il y a peut-être des annimations. On reprend la route à la recherche d’un bel endroit pour la nuit et on arrive rapidement dans la baie « Baja Conception » qui est magnifique, on passe davant un RV park qui se trouve sur la plage, face à la mer, on s’y arrête pour la journée et la nuit. Il ya pratiquement que des Snowbirds hyper équipé. On se pose près d’un palapas (cabanne de plage) et en fin d’après-midi une dame vient collecter le prix de la place, 200 pesos.", 
