        "photo" : false, 
        "wakeUpTemperature" : 24, 
        "comments" : "Départ de Loreto et la mer de Cortes pour le pacifique. Si les premiers kilomètres sont très beau dans ce paysage de montagne longeant la côte, rapidement on bifurque plein Ouest et la route beaucoup moins belle, plus monotone. Arrivés à Ciudad Insurgentes, nous quitons la Ruta 1 en direction de la côte et de Adolpho Lopez Mateos qui est également un lieu où les baleines grises viennent pour fuir l’hiver de l’Alaska et mettre bas. Sur la route, tous les kilomètres environs se trouve d’immenses poteaux surplanté d’une petite plateforme que les rapaces, certainement des baluzards utilisent comme nids. La pluspart sont occupés.\n Nous traversons le village et allos directement au « Santuario de la ballena Gris » où l’on peut se garer pour la nuit et où se trouve tous les bateaux des tours operators. Le complexe est jolie et animé avec boutiques d’artisanat et souvenirs, restaurants. Nous voyons des touristes arriver d’un tour de bateau et ils nous disent qu’ils n’ont vu aucune balleine. Il parait qu’en raison du réchauffement climatique elles arrivent de plus en plus tard en saison. On décide de passer la journée là, on verra demain pour les baleines. En fin d’après-midi on fait une petite balade dans le village, on s’arrête dans une épicerie pour acheter quelques trucs, on est toujours surpris des prix qui sont vraiment abordables.\nVers 18h00 Christophe tape à notre porte pour nous invitez chez eux. A ce moment là u n mexicain arrive vers nous et nous explique que c’est lui cette nuit qui à en charge la sécurité du site, Christophe qui parle courament l’espagnol lui parle puis au bout d’un moment le gars lache « Propina » on lui donne 20$Mex puis il retourne dans sa voiture. Chez Cristophe et Jean-Pierre nous passons une très bonne soirée à discuter autour d’une Margarita maison !!!", 
