        "comments" : "Nuit calme. Ce matin François et Yumie partent suivient de Christophe et Jean-Pierre. On devait faire avec François un tour en PMT mais quand j’ai voulu cherché mes palmes dans un petit coffre elles n’y étaient plus ainssi que notre petite valise cabine… La serrure ne semble pas avoir été forcée, j’avais peut-être oublié de le fermé à clé. Nous trainons toute la matinée, corinne me coupe les cheveux et nous partons faire un tour en ville de Cabo San Lucas en début d’après-midi le long de la marina. Je renouvelle mon abonnement à Tecel puis nous quitons la ville en direction du Nors-Est côté mer de Cortes. Nous passons au niveau du Tropique du Cancer où un genre de visitor center à été construit. A notre arrivée tout est fermé. On poursuit un peu pour trouver un bivouac un peu à l’écart en pleine nature du côté de Santiago mais finalement il y a beaucoup trop de piste à faire, on renonce, faisons demi-tour et nous posons sur le parking du tropique….", 
