        "comments" : "Journée calme avec un temps mi figue mi raisin. On en profite pour pofiner les photos et l'article qui retracera notre traversée de la péninsule de la Basse-Californie où nous aurons passé plus d'un mois finalement. Entre Pacifique et mer de Cortes nous aurons traversé des décors fabuleux aussi bien désertique et maritime. La rencontre avec les baleines grises restera une expérience inoubliable, nous nous sommes émerveillés de leurs parades amoureuses avec ces saut hors de l'eau, c'est battements de queue ou de nageoire, ces souffles qui viennent rompre l'horizon. Nous y avons également fait de très belles rencontres, françois et Yumie et Christophe et Jean-Pierre avec qui nous avons partagé un bout de route et de très bonnes soirées. Nous avons trouvés les mexicains très sympatiques, ils ont toujours fait de gros efforts pour nous comprendre et nous aider.\n", 
