        "photo" : false, 
        "wakeUpTemperature" : 25, 
        "comments" : "Nuit ronronante sur le bateau. Ce matin nous allons prendre notre petit déjeuner à la cantine du bateau. Au menu café, et assiète d’oeufs brouillés avec jambons, poivrons chorizo et purée de harricot.. \nL’arrivée sur mazaltan est sympa c’est dommage que le temps soit nuageux. Pour sortir du bateau les agents sont obligés de mettre des cordages sous les roues avant de Thor pour ne pas que le chassis touche. Nous passons directement par le malecon qui est très beau, agrémenté de sculptures. Nous nous arrêtons au niveau du « Mirador » et faisons une longue marche en bord de mer. Pour rentrer au centre ville nous prenons un « Taxi local » genre de petite voiturette qui permet de se faufiler dans le rue étroite de la vieille ville. Nous faisons un arrêt à la Basilique qui est magnifique et pleine de monde puis nous déambulons dans les rues très animés, colorés. Nous nous arrêtons dans une très belle patisserie où tout fait envie, comme c’est également un restaurant nous décidons de manger sur place, excellent repas. Nous repartons après avoir acheté quelques gâteaux qui étaient plus beaux que bons, mais on les a quand même mangés… De retour à Thor nous reprenons la route pour s’occuper de la logistique, vidange de Thor chez Ford puis le plein d’essence et de Gaz. Journée bien rempli. En fin de journée on se gare près d’un parc pour passer la nuit.", 
