        "wakeUpTemperature" : 22, 
        "comments" : "Ce matin depart de Mazaltlan direction le centre et la montagne. Pour accéder à Durango il y deux route possible l’ancienne, très mauvaise et très longue, compter près de 6 heures pour rejoindre ou 3heures 30 en passant par « l’autoroute ». Corinne n’apresciant pas trop les route de montagne ont optes pour la deuxième solution. En route on s’arrête à Concordia, petit villa mexicain typique contruit autour de sa mission. Nous reprenons la route et attaquons la montagne, nous achainons les tunels et les ponts sur plus de 100 kilomètres pour arriver à près de 2000 mètres à Durango. Au total nous passons 5 péages autoroutiers est payons au total 55€. C’est assez cher mais quand on voit le nombre d’ouvrages d’art on comprend mieux. Au niveau du dernier péage, les guerites sont vides, personne pour collercter l’impôt puis à une centaines de mètres on voit de nombreuses personne? pas de la société d’autoroute, bloquer la route. Tiens des gilets jaunes sans gilets jaunes ? C’est un peu cela, il rackette tous les automibilistes de la somme de 50 $/Mex. J’essaie bien de poser des questions maiis en réponse j’ai juste 50$. Pas le choix que de payer. Plus loin je vois un policier, je m’arrête et lui demande si c’est normal, il se met à m’expliquer  plein de choses dont je n’ai rien compris mais devant son inaction ce doit être normal…\nArrivé à Durango on file directement au cimetière de Panteón de Oriente abrite l'un des exemples les plus étonnants d'art funéraire de l'ère porfirienne au Mexique. Il fonctionne toujours comme un lieu de sépulture et a également été désigné musée culturel, présentant des centaines de tombes remarquables sculptées par le maître de carrière Benigno Montoya entre 1898 et 1929.\n\nAprès cette visite nous partons faire le plein dan sun Walmart et regagnons un bivouac autour d’un parc.", 
