        "walk" : 0, 
        "photo" : false, 
        "wakeUpTemperature" : 14, 
        "comments" : "Nuit vraiment calme pour autant que nous sommes vendredi soir et en pleine ville.\nCe matin après avoir téléphoné aux enfants nous quitons Durango par le Nord pour nous arrêter à « Viejo Oesto » un genre de parc d’actraction autour du western. Durango est la ville du cinéma et où de nombreux Westerns américains y ont été tournés. Peut-être dans ce genre de « Cine Cita ». Nous arrivons à l’ouverture, 11 heures, à l’entrée des panneaux genre indicateur avec des noms de célèbres films. Nous faisons le tour de la rue principale. Certe ce n’est pas Tombstone ou Oatman mais on y retrouve la banque, le sallon le sherrif, l’hôtel …. Le petit plus du week-end c’est un spetacle de rue avec une bonne vingtaine de personnes en habits d’époque, lourdement armés  et à cheval. A midi nous mangeons en terrasse du saloon et à 13h30 commence le spectacle qui dure 45 minutes et qui retrace l’histoire mexicaine, la révolution, avec le géréral de l’armée régulière et Poncho Villa. Beaucoup d’humour et de dérision dans le show, on a vraiment passé un bon moment. Si à hollywood boulevard il y a le walk of fame, ici c’est le cimetière of fame, plein de tombes avec sur la stelles des noms célèbres.\nNous reprenons la route plein Sud cette fois-ci en direction de Zapatecas, et faisons un prtit détour pour aller voir les Cascades Del Salsito. Nous payons un petit droit d’entrée 20$/Mex pour pouvoir nous garer. Il s’agit d’un grand cirque où trois cascades tombes dans un petit lac. L’endroit est très beau mais il faut descendre les marches qui vous conduisent tout en bas pour se baigner le cas échéant mais surtout pour aprécier les lieux, au bord du lac puis de la rivière où l’eau s’ecoule se trouvent d’immenses arbres, je pense de la famille des l’acacias, plus que centenaires, couverts de mousses espagnoles avec des racines énormes, octopussiennes. Les lieu est vraiment magnifique et reposant. \nNous reprenons la route pour notre bivouac du jour au Parque Nacional Sierra De Organos et changeaons d’Etat pour rentrer dans la Zapatecas. Nous passons deux check-point un de la police d’Etat et l’autre sanitaire mais aucun ne nous contrôle, on a sauvé les oranges…\nNous payons 40$/mex/Pers pour pouvoir y accéder et dormir une nuit. Les montagnes alentours sont très belles,trs découpées un peu comme à Chiricahua. Nous trouvons un emplacement et comme la nuit ne va pas tarder à tomber nous remettons la balade au lendemain. Alors que nous somme devant Thor un 4X4 passe devant nous et le chauffeur s’arrête devant et nous demande si nous avons fait le trail puis certainement devant mon accent me demande d’où nous venons et quand je lui dit de France, tout le monde c’est mis a commenter, ils sont tous decendus, 7 personnes, pour discuter et nous prendre en photos…. En fait le papa habite non loin de là et tous les autres sont d’ici mais habitent à Boston aux USA. Nous avons bien discuter, nous leur avons donné des drapraux français ils étaient super contents puis nous ont félicité pour ….. la coupe du monde. Les gens sont vraiment adorables…", 
