        "comments" : "Nuuit très calme au bivouac. Ce matin déaprt pour une randonnée dans ce très beau parc. C’est à la mexicaine donc pas trop d’indication, on tombe par hazard sur les départ de trail qui sont bien matérialisé, le chemin est entre des pièrres. Je fais un grand tour et emprunte plusieurs tracés différent, le formations rocheuses sont très belles et font penser un peu à chiricahua. Lors du trail j’ai croisé une famille de Mennonites, tous en costumes, ils sont plus de 100000 au mexique et sont souvent blond au yeux bleus et parle surtout allemand. Il ya une communauté non loin de là à « La Honda ».\n\nOn mange a mon retour puis on reprend la route direction Zapatecas. La route nationale n’a que deux voies plus un bas côté, bande d’arrêt d’urgence. Il est de coutume ici de rouler a cheval entre la voie et le bas côté ce qui permet aux autres automobilistes de doubler, même s’il y a un bande continue. En face ils font pareil…..\nOn veut rentrer dans une petite ville pour y chercher de l’eau potable mais très vite la rue a retrécie, imossible d’avancer ou de reculer. Corinne est sortir régler la circulation de main de maître afin que je puisse reculer j’usqu’à l’entrée…\nArrivé en ville nous allons directement dans un Sonaria faire les courses avant de trouver un bivouac non loin. Aux feux rouges, il n’est pas rare de voir des clownx, jongleurs ou cracheur de feu faire l’animation durant le feu rouge pour récolter quelques pieces.", 
