        "distance" : 52750, 
        "distanceTrack" : 0, 
        "walk" : 6200, 
        "photo" : false, 
        "wakeUpTemperature" : 0, 
        "comments" : "Nuit calme sur notre parking…\nCe matin on commence par chercher de l’eau potable, on en trouve en ville mais ils n’ont pas de tuyau et le notre ne s’adapte pas, en fait ils se contentent de replir de garafon. Finalement le proprio et également le propriétaire deu restaurant à tenant et il nous propose de l’eau du robinet, non potable, ce que nous faisons.\nNous prenons la route ensuite pour aller au Sud-Ouest de Zacatecas à une quarantaine de kilomètres pour visiter le site archeologique de La Quenada ou Chicomoztoc construit et habité entre le 3 éme et le 8éme siècle. Véritable forteresse construite sur 5 niveau au sommet d’une colline qui permettait d’avoir une vue à 360 sur tous les environs. L’agent à l’entrée nous liste toutes les reductions et finalement en tant que retraité, c’est gratuit pour moi…. Malheureusement le musée qui présente une maquette complète du site est fermée. On fait une belle balade qui grimpe assez fort.\nRetour sur Zacatecas  où nous nous arrêtons dans une bibliothèque puis nous regagnons notre bivouac du soir sur un sommet de la ville qui est très belle de nuit. Je vais voir la policière au poste de police qui m’autorise à passer la nuit là sous sa bonne garde…et 50 pesos.", 
