        "distance" : 52893, 
        "distanceTrack" : 0, 
        "walk" : 6600, 
        "photo" : false, 
        "wakeUpTemperature" : 7, 
        "comments" : "Nuit très froide, ce matin on se lève dans le brouillard..\nDépart pour Guadalupe, ville qui touche Zacatecas. On s’arrête au Couvent de Guadalupe qui abrite également un musée.\nL’église est très belle et la couvent Franciscain a été transformé en musée qui abrite un grand nombre de toiles de l’art religieu. Très bien aménagé et entretenu le musée est vraiument à faire, déjà pour l’architecture mais également pour toutes les toiles accrochées qui présente la vie de Jesus des on entrée triophante à Jérusalem jusqu’à sa résurection, l’histoire de Marie et bien entendue l’histoire des St François d’Assise et des Franciscains.\nNous prenons ensuite la route en direction de San Luis de Potosi et changeons pour l’occasion de Région. Nous faisons quelques courses dans un soriano, ici les pots de Nutella ont un collier antivol… nous nous garons près du centre ville pour une balade dans la vieiile ville qui très belle et très animée en cette fin d’après-midi, nous visitons plusieurs édifices religieux. Les mexicains sont très religieux et très souvent ils se signet à chaque fois qu’ils passente devant un église, autant dire que c’est fréquent… La ville porte le nom du roi de France, Saint Louis… a creuser…\nPeu avant la nuit nous reprenons la route et trouvons un bivouac près d’une station service Total, pas glamour mais bien pratique…", 
