        "comments" : "Nuit très calme, nous somme reveillés ce maton par les chants des oiseaux…\nDépart pour les deux dernières Missions à savoir celle de Tilaco et de Tancoyol.\nNous traversons la ville de « La Lagunita » où se déroule un grand marché en ce samedi matin. Les vrais cowboys sont ici plus aux USA, tous les hommes d’un certains âge sont tous habillés d’un jean, de bottes d’une chemise et d’un beau chapeau couleur crème, sans oublier la ceinture en cuir à laquelle sont accroche des étuis en cuir. Ils sont très class..\nNous arrivons à la mission San Francisco de Tilaco, malheureusement elle est complétement à contre jour, pas facile pour les photos.\nNous reprenons la tout pour visiter la dernière qui se trouve au fond d’une valléeNotre Dame de la Lumière de Tancoyol. Encore un charmant petit village avec sa mission.\nNous décidons de retourner à Landa De Matamoros, il sestrop tard pour reprendre la route. Une fois arrivés, je vais sur la place du village qui propose du WiFi et je m’occupe du couriers et des photos. J’assite, de moin, à un mariage à la mission, c’est comme chez nous, madame avec une robe blanche avec une longue traîne et à la sortie de l’église envoi de riz.\nLe soir on décide d’aller manger dans un petit restaurant de rue qui se trouve en face la mission. Comme de vois 4 jeunes attablés à cotê de nous avec pas mal de cannettes de bière, on passe commande de /\n-  Gringas (tortilla avec fromage et lanières de steak)\n- de Taquitas de Adobo (petite tortilla avec des oignons de la salade et des lanières de steak) \nle tout avec sauces et citron vert et je demande donc une bière. Le patron est un peu géné car il ne peut en vendre, un jeune se lève et me donne une de leur cannette qu’ils ont amenés, super sympa. On passe une très bonne soirée, on entend on fond du village la musique de l’animation du mariage.", 
