        "comments" : "Au final nuuit calme, la musique c’est rapidement arrêtée.\nCe matin on reprend la route vers le Sud-Ouest, direction Tequisquiapan, ville de villégiature appréciée par les habitants de Mexico.\nOn traverse toute la sierra Gorba par une longue route de montagne au milieu du massif on traverse des zones biens vertes avec de beau arbre et de l’herbe verte, ça fait du bien… \nAu niveau de Bernal nous bifurquons vers Cadereyta de Montes pour visiter le Jardín Botánico Regional de Cadereyta, on arrive juste une heur avant la fermeture, cela nous permet de nous dégourdir les jambes et d’avoir un apreçu de tous les cactus présents dans la région de Queretao.\nNous filons ensuite à Tequisquiapan ou Thor trouve son emplacement pour la nuit et près du centre pour demain.", 
