        "comments" : "Nuit calme en plein centre ville.\nCe matin on traine un peu dan Thor, on prend des nouvelles de toute la famille.\nVers 11h00 on part à pied dans le centre ville qui est très beau avec de belle boutiques, beaux restaurants, on voit que les haibitants de mexico veiennt ici en villégiature. On visite la Parroquia Santa María de la Asunción su la belle place Miguel Hidalgo entourée d’arches et de boutiques. Nous traversons plusieurs marchés artisanux et finissons notre visite au Parc La Pila. A midi nous mangeons dan sun très bon restaurant, Tacos au boisson pour moi et genre d’esalope Milanaise pour Corinne sans oublier le dessert, un genre de tarte au citron pour moi et un gateau au chocolat pour Corinne.\nEn milieu d’après-midi nous décidons de lever le camp direction la capitale régionale : Qerétaro.\nA notre arrivée nous nous posons près d’une lavandéria pour faire une bonne lessive faisons le plein d’eau et de gazoline (Magna) dans une station Pemex et finissons la journée dans un Soriano pour faire le plein du frigo. Finalement nous restons sur le parking pour la nuit.", 
