        "comments" : "Nuit calme mais fraiche, c’est dingue l’écart qu’il y a entre le jour et la nuit.\nCe matin on part en ville avec Thor pour se garer près duuc enre historique, la ville est très grande près de 700 000 hbts mais les rues sont vite très étroites. Après plusieurs manoeuvre pour se sortir de ruelle on décide de faire retour sur notre parking de Soriano. On change notre garafon vide pour un plein dans un magasin OXXO et on se pose. Du coup on mange dans Thor et on prend un taxi pour rejoindre le centre, c’est plus pratique et vraiment pas cher, 70$/Mex à l’aller et 50$/Mex au retour.\nLa ville est vraiment très belle et très propre. On fait un gand tour pour voir principalement des édifice religieux et des couvent transformés en musées, très souvent gratuit.\nEn fin de journée un taxi nous raméne à Soriano.", 
