        "photo" : false, 
        "wakeUpTemperature" : 17, 
        "comments" : "Nuit de merde mais nuit calme.\nCe matin on prend le car pour le centre ville. On commence par l’Institut Culturel Cabanas, magnifique batiment, ancien horphelinat neoclassique datant de 1805 qui abrite de superbe fresque commentée par un guide et de nombreuses salles d’expositions. Il compte 23 Patios, et loa capilla mayor qui compte 40 fresque datant de 1939 réalisées par José clementé Orozco. Devant le batiment se trouve des scultures en forme de siège en broze assez étonnantes.\nDe là nous empruntons une longue rue piétonne remplie de commerçant ambulant qui nous mène au centre avec son théatre, sa maisons du Gouverneur, sa cathédrale et son hotel de ville plus quelques églises. La ville met à disposition des tables avec des jeux de dames et d’échecs, des personnes jouenet ainsi dans la rue. Sur la plaza de armas se trouve un magnifique kioske à musique de style Art nouveau ornée de cariatides portnts des intruments de musique, construit en France\nEn fin d’après-midi nous sommes rejoints par François et Yumie. On ne s’était pas revus depuis la basse Californie. Nous dinons dans un restaurant spécialisé dans la chévre ous forme d’effilochée à cuisson lente. Birriera Las 9 Asquinas. J’ai eu le malheur de vouloir me faire un tacos avec les ingrédients sur la table, notamment des oignons roses, j’ai cru mourir tellement c’était fort? j’en ai pleuré pendant 5 minutes… On est rentré en taxi et on a fini la soirée devanyt une bière ches François et Yumie.", 
