        "wakeUpTemperature" : 17, 
        "comments" : "Ce matin on quitte Francois et Yumie et nous prenons deux cars de ville pour nous rendre au centre historique de Tlaquepaque. Ce village tourné vers l’artisanat a été peu à peu fagocité par l’expension de Guadalajara pour devenir aujourd’hui un quartier de banlieu. Toutefois ils ont sus garder leur âme de village et le centre ville a été très bien aménagé, pour les touristes , les rue pirtonnes regorges de boutiques et de restaurants. Destinée à une clientélle assez aisée, nous y avons vus de très beaux magasins de meubles, décorations… Nous avons visité les deux musées de la faience, très beaux. A midi nous mangeons dans un très bon restaurant, El Patio. A l’entrée, la recptionniste nous demande d’où nous venons, elle ouvre un grand tiroir avec tous les drapeax bien rangés et elle nous sort le drapeaux français qu’elle pose sur notre table. Du coup on peu voir dans la salle la provenance de chacun. Pour les mexicain se sont les drapeaux de l’Etat. Nous étiosn pour le coup les seul francais.\nNous reprenons ensuite le car pour le centre ville de Guadalajara puis un taxi jusqu’à notre bivouac avant de faire route vers Tequila en route plein d’eau et d’essence.", 
