        "photo" : false, 
        "wakeUpTemperature" : 21, 
        "comments" : "Nuit très bruyante, c’est vraiment des fêtards ces mexicanos…\nC’est Dimanche, on prend le temps. Il fait très beau et le gens affluent sur le Malecon. En fin d’après-midi nous faisons une balade en bord de lac, c’est le point de raliement de très nombreuses personnes. Les plus petit sont dans l’eau, une eau très sale, le lac est extrémement polluée, et les gens piqueniquent sur l’herbe, il y a de nombreuses boutiques ambulantes, de mariachis, c’est bondé, bruyant, les cannettes de bières vides sont légions mais l’ambiance est bonne enfant.\nSoirée tranquille dans Thor. Demain on reprend la route…", 
