        "note" : "3", 
        "distance" : 54037, 
        "distanceTrack" : 0, 
        "walk" : 0, 
        "photo" : false, 
        "wakeUpTemperature" : 21, 
        "comments" : "Nuit calme… enfin.\nNous quittons notre parking après avoir fait le plein d’eau.\nOn décide de longer un peu le lac avant de prendre une route un peu plus importante pour la destination du jour. Finalement l’eau du lac est assez haute car nous voyoons de nombreuses terres inindées, nos voyons également une importante colonie de pélicans blancs.\nAu bout d’une quinzaine de kilomètres la route se transforme en petit chemin pavé de pierres volcaniques, nous sommes contraint de faire demi-tour. On repase par Chapala et nous prenons l’autopista que nous quittons à « La Balanca ». nous en profitons pour faite le plein de gaz et pur déjeuner. On tente de faire un échange standard de notre Garrafon mais nous n’avons pas la bonne marque pour ce magasin… On fait route ensuite sur Angahuan, village qui nous permettra de voir le seul volcan encore actif du Mexique le Puricutin.\nLa route est un veritable calvaire, trous, topes, et parfois plus de route… Nous sommes surpris de la pauvreté de village traversés et de l’état lamentables de bas côtés de la route qui sont ni plus ni moins que des décharges publique. heureusement nous sommes en montagne et nous voyons de vrais arbes, bien grand bien vert…Dans les campagnes nous croisons encore beaucoup de caballeros qui chevauches leurs ânes. Nous traversons également des villages d’indiens Purépechas dont les femmes sont enroulées dans leurs châle souvent sombre.\nOn traverse un village qui fini par un pont et Thor est trop large pour lui, obligé de faire un détour dans des ruelles pour sortir au delà du pont. Arrivés à Angahuan nous prenons de l’essence car nous sommes en réserve depuis un bon moment. Nous devons traverser le village pour accéder à notre bivouac je crains le pire. Nous sommes rattrapés par deux cavalier qui nous demandent su demain nous voulons faire l’excursion au volcan, je leur fais coprendre que pour l’instant je suis occupé. Finalement ils passent devant nous et nous ouvrent la route. Il faut dire que dans le village c’est effervescence. Certainement en raisons du carnaval il ya une immense bagarre à coup de jet de farine, tous les habitants que nous croisons sont blanc… Dans le petit chemin pavé toujours avec des pièrres volcanique, nos ouvreurs font partir un camion qui m’enpêche de partir, démontent des toiles tendues trpp basse pour Thor… Bref on arrive à El Mirador. On se gare et nous discutons de l’escursion de demain matin vers le volcan à Cheval, ca promet…\nPrès de 8 heures pour faire 300 Km…", 
