        "distance" : 54188, 
        "distanceTrack" : 0, 
        "walk" : 4000, 
        "photo" : false, 
        "wakeUpTemperature" : 13, 
        "comments" : "Ce matin on quite Patzcuaro pour faire le tour du lac puis direction Morélia.\nNous sommes en plein « territoire » des indiens Purépechas qui vivent ou plustôt survivent principalement de l’artisanat. Chaque village c’est un peu spécialisé, Tocuaro pour la fabrication des masques, Jaracuaro pour les chapeaux de pailles, Erongaricuara où nous avons visiter son couvent franciscain de type plateresque du XVI éme et fait un tour sur sa place et enfin Tzintzuntzan pour son site archeologique, centre cérémoniel et capitale du Royaume tarasque, fermé aujourd’hui… son couvent franciscain transformé en musée très beau, son église dont le plafont et en céramique et son oliveraie dans l’atrium avec des oliviers qui date de la colonisation. Pour ma part je n’en n’avais javais vu d’aussi gros, pas en très bon état mais de plusieurs mètres de circonférence. Etant un lieu très touristique, autour du couvent se trouve un marché local qui vent à peu près tout ce que l’on trouve dans la région sachant qu’elle même est la capitale de la vanerie. Mais on y trouve aussi des sculture en bois et pierre, souvent religieux, des petit meubles en bois et beaucoup de céramique.\nOn fait ensuite route vers Moralia où on se pose à l’entrée de cette ville de 700000 Hbts sur un immense parking très ombragé, on a même droit à quelques goutes de pluie ce qui fait du bien…\n", 
