        "photo" : false, 
        "wakeUpTemperature" : 20, 
        "comments" : "Nuit très calme..\nOn prend le collectivo juste sur le boulevard près du bivouac. En ville se sont souvent des vans amnégés qui passent partout. Du coup on rentre par une porte latérale et on passe l’argent afins qu’il arrive au chauffeur qui encaisse. Du coup on passe le voyage à passer l’argent dans les deux sens. Les chauffeur on souvent une boite de rangement maison pour les pièces et ils tiennent les billets entre leurs doigts de la main gauches.\nUne fois en centre ville on visite comme toujours, la cathédrale (très belle), la place de armas, le palais du gouverneur, la mairie, les autres églises et couvents, la maison de la culture et les différents musée qui sont souvent gratuits.\nCette ville de plus de 700 000 Hbts n’est pas extraordianaire mais comme toujours très animées. A midi on fait exception et on mange dans un Burger King. En fin d’après-midi on reprend la collectivo pour se rendre au Sanctuaire de notre dame de Guadalupe. L’église est particulièrement chargée, très chargée. Au retour à Thor on prend notre matériel et nous allons dans une bibliothèque qui reste ouverte jusqu’à 20h00 pour traiter nos photos et vidéos. Le Wifi est correct.", 
