        "walk" : 3000, 
        "photo" : false, 
        "wakeUpTemperature" : 20, 
        "comments" : "Ce matin on quitte Morélia par la route des couvent « Ruta des los coventos » En route nous prenons de l’essence dans une station Pemex ainsi que plein du réservoir d’eau. Ici à chaque pompe à essence se trouve un tuyau pour l’air et un pour l’eau mais le débit est vraiment faible. L’employé me trouve un « vrai » robinet sur la station pour remplir Thor. \nNotre premier arrêt se fait à « Cuitzeo Del Porvenir » on y arrive en traverssant un lac sur une digue. Le couvent est effectivement imposant et s’inscrit dans un ensemble de batiments implantée autour d’une place, plusieurs églises, un ancien hôpital. Nous arrivons en pleine messe dominicale, il y a tellement de monde que les paroissiens écoutent le messe depuis le parvis. On se rabat sur le couvent qui a été transformé en musée. Le res-de-chaussé du cloitre présnete quelques salles où sont présentés tableaux et objets divers tandi que l’étage est resté tel quel, on passe dans tous les lieux de vie des moindes à l’époque. De nombreuses fresques sontgt encore visible en monochromie pour la pluspart. Sur la place un orchestre joue et les gens boivent et mangent, au Mexique comme aux USA, on a l’impression qu’ils mangent non stop.\nOn reprend la route pour visite le couvent de Yuiria. Luis aussi de style Platesque caractéristique de la Renaissance Esâgbole le batimet ressemble plus à une forteresse qu’à un édifice religieux. Malheureusement il est ferme pour travaux. On poursuit sur route la route des couvents jusqu’au sanctuaire des papillons monarches à El Rosario. Nous passons dans un premeir temps par Angangueo mais vu la taille de route on fait demi tour et passons par Ocampo. La route qui monte à 3000 mètres d’altutude et aprsemée de Topé, c’est vraiment chiant. Arrivé au sanctuaire nous bivouaquons directement sur le parking du site. On verra demain matin…", 
