        "photo" : false, 
        "wakeUpTemperature" : 12, 
        "comments" : "Nuit fraiche à ces altitudes….\nCe matin on se lêve le parking est presque vide, généralement réservé aux propriétaires des boutiques souvenir et restaurant. Déjà de nombreux papillons… papillonnent déjà. Il faut dire qu’ils aiment la chaleur et quitte leur grappe accrochée aux branches que lorsque le soleil chauffe leur ailes.\nVers 10h00 on se dirige vers l’entrée, on paye les deux entrée 50$/Mex/Pers. qui comprend également un guide. Nous pastons à l’assau de la montagne, cela fait du bien de marcher en pleine foret avec de beaux résineux. On sent l’altitude, le souffle est court mais notre guide s’adapte à notre rythme. Le sol est tapis de monarches morts, si on a bien compris des males. C’est un moment magique d’en voir autant, il y en a des millions. Grace aux informations de Cristophe et Jean-Pierre nous demandons à notre guide de finir la boucle par le chemin utilisé par les chevaux. On arrive ainsi dans un grand près où ils sont des milliers c’est féerique… On prend le temps de prendre des photos et vidéos, la guide attend patiemment, en plus nous sommes en semaine et presque en fin de saison. D’ici une dizaine de jours ils vont entamer leur migration. Sur les 5 sites, seuls 2 sont visitables, El Rosario est le plus connu.\nNous reprenons la route et Corinne s’amuse à compter les « Topés » Entre l’embranchement Angangueo et Ocampo et le sanctuaire soit 17 Km, il y a pas moins de 61 Topés, les mexicains ont vraiment un problème avec ça…\nOn reprend la route après avoir pris un peu d’essence et on décide de prendre l’autoroute pour ralier Tula…\nOn passe au site archéologique mais le gardien nous indique que l’on ne peut pas y passer la nuit, ce sera donc le parking du soriana.\n", 
