        "wakeUpTemperature" : 32, 
        "comments" : "On passe la matinée à trainer, à midi nous allons mangé au restaurant de l’hôtel Las Grutas, très bon repas accompagné d’une Corona et d’un desser, glace pour Corinne et pour moin un truc bizarre, un genre de flan mais ferme et en morceau, c’était bon..\nAprès-midi a travailler sur le blog puis un bon bain avec talasso dans la cascade un pur bonheur de détente.\nOn arrive ensuite à faire le plein d’eau et le vide des eaux grises puis vers 18h00 nous attaquons l’ascencion de cette route incroyable pour nous arrêter tout en haut sur un parking pour les cars. Le dénivelé est de 566 mètres  sur 7 Km. Arrivé sur le parking un vieux monsieur se porte à ma hauteur, on lui achéte de Pane de Pulque, on a va gouter ce soir…", 
