        "photo" : false, 
        "wakeUpTemperature" : 17, 
        "comments" : "Nuit très bryante. Ce matin le temps est couvert, on passe par le centre ville de Pachuca pour voir l’horloge «Reloj Monumental de Pachuca» en route on observe sur notre droite tout un quartier sur une colline où toutes les maisons ont été peinte pour formé un grand motif, malheureusement je ne peux pas m’arrêter pôur prendre une photo. Arrivé sur la grande place de l’indépendance, un policier m’accorde 5 minutes de stationnement en vrac le temps de faire le tour de la place et prendre en photo la fameuse horloge. \nNous quottons la ville, nous nous faisons contrôler par un policier, on lui donne nos photocopie de nos passeport, tout va bien, circulez…\nNous faisons route jusqu’à Tepotzotlán, je ne veux pas prendre l’autoroute mais la route secondaire est usante… En début d’après-midi nous visitons le Museo Nacional del Virreinato qui se trouve dans un ancien couvent, la visite est très intéressante, les batiment immense et l’église, San Francisco Javier, et ces chapelles, surtout Capilla Casa De Loreto, impressionnantes au niveau de la décoration. Après un tour sur la grande place noire de monde, de boutiques. C’est samedi et il y a plusieurs mariages, nous croisons même une princesse…\nIl est encore tôt et nous décidons de poursuivre jusqu’à Toluca, par l’autoroute cette fois-ci. Nous contournons Mexico pour l’Ouest mais on a l’inpression d’être déjà dans sa banlieu. Arrivé à Toluca on galère pour trouver un boivouac, tous les parkings des grand magasins, ont des entrées payante avec une hauteur limite de 2m30, autant dire que Thor ne passe pas. Il fait nuit et on tourne dans cette immense ville de 800 000 hbts pour au finir se poser dans une rue un peu large…On verra bien..", 
