        "wakeUpTemperature" : 20, 
        "comments" : "Ce matin visite du site archéologique de la ville, en la traverssant je tombe sur une cérémonie sur la gran,de place à l’occasion du 213ème anniversaire de la naissance de Benito Juares Garcia …. e nombreuses personnes et de classe sont présents. Entre les discours, des chants et danses. Le temple accroché à la montagne où on y accéde par unt longue montée. Ce site religieux a été construit là car depuis son point de vue on voit pointer le soleil juste au desuus de la montagne lors de 3 solstice.\nOn quite ensuite Malinalco pour descendre vers le Parc national Grutas de Cacahuamilpa. On se gare sur le grand parking et on en profite pour demander si l’on peut passer la nuit inci, c’est OK. Je pars faire la visite de cette grotte qui est assez impressionnant. Le plafond se situe entre 20 et 70 mètres de hauts, le plsu souvent vers 35 mètres. On parcour le boyau sur 2 Km avec un guide. La grotte ferait plus de 70 Km de long. En fin de parcour le guide laisse toute latitude à chacun de refaire le parcours en sens inverse à son rythme. je me suis retrouvé avec un groupe de 4 mexicains avec qui j’ai beaucoup discuté, on est rapidement devenu pots, ils sont vraiment adorables.\nLe soir le gardien du site, un monsieur d’au moins 70 ans est venu nous dire que c’est lui cette nuite qui surveillé le site, nous voilà dessuite plus rassuré, nous lui avons donné une propina.", 
