        "distance" : 55140, 
        "distanceTrack" : 0, 
        "walk" : 4700, 
        "photo" : false, 
        "wakeUpTemperature" : 0, 
        "comments" : "Nuit calme sur notre camping. Ce matin on prens des nouvelles de la famille puis nous prenons la route des couvents qui nous améne dan sun premier temps à **Tepoztlan**. C’est dimanche, les march\tand ambulants sont tous de sortie autant dire que circuler dans cette ville est compliqué, comme dans toutes les villes finallement. Nous arrivons quand même à nous garer dans une petite rue. On attend un peu, le bus arrive à passer, on peut y aller. On commence par le musée Carlos Pellicer qui présentes des objets de l’ère préhispanique. Juste derrière se trouve le couvent de la Nativité. De l’atrium on arrive au cloitre qui présente quelques belle fresques. L’église et le reste du bâtiment sont fermés pour cause de travaux, ca en à bien besoin, les deux clochers sont étayés, on peu y voir d’énorme fissure. \nOn arrive à sortir tant bien que mal de la ville pour nous dirriger vers **Yecapixtla**, là aussi on cemprend très vite que l(on ne trouvera pas de place et on sort de la ville pour se garer un peu plus loin. La aussi pas de chance, on peu bien rentrer dans l’atrium mais l’église est fermée pour cause de travaux, les messes se déroulent dehors sous chapiteau. On peu quand même faitre le tour du cloitre dont les fresques sont bien abimées. Du coup on laisse tomber **Ocultuco** et **Atlatlahuacan** qui sont juste citées dans le guide pour nous concentrer sur ce qui doit être le plus beau à savoie à **Tlayacapan**. On se gare directement à l’entrée de la ville et nous y allons à pied, on passe devant de nombreux stands de vente de souvenirs et arrivons à l’entrée du couvent qui est entièrement échaffaudé, fermé également pour de long mois pour cause de restauration.\nSe sont les plus beau monatères qui entoure le volcan popocatepetl (Qui est en erruption actuellement) qui ont été inscrit en 1994 au patrimoine mondial de l’Unesco. Peut-etre ont ils percus de grosses sommes pour leur restauration…..\nNous quittons la zone pour prendre la direction de Puebal, on se pose sur un grand terrain d’une station Pemex contre un petit billet de 20 pesos pour le gardien de nuit qui doit avoir ici aussu plus de 70 ans…\n\n\n\n\n\n", 
