        "distance" : 55233, 
        "distanceTrack" : 0, 
        "walk" : 5200, 
        "photo" : false, 
        "wakeUpTemperature" : 25, 
        "comments" : "Nuit calme sue le parking de la Pemex.\nCe matin on part en direction Puebla. On opte pour une route un peu plus longue mais sans péage et avec peu de virage. En route on contourne par le Sud l’ompsant Volcan Popocatépetl (5450) qui était eruption il y a quelques jours encore et d’où s’échappe encore de son flan et de son cratère de la fumée. A coté de mlui se trouve un autre volcan, le Itzaccihuati (5280), endormi.\nNotre premier arrêt se fait avant de rentrer dans la ville de Puebla à l’église de San Francisco Acatepec puis route vers Cholula où nous faisons une pose à l’esglise de Santa maria Tonantzintla puis arrêt au centre de Cholula. Nous visitons la magnifique église de la viregen de los Remedios. Située à 65 mètres de haut elle domine la ville et offre une très belle vue sur la ville et les volcans. A sa base la pyramide Tepanapa. De retour nous passons à léglise et au Convento de San Gabriel Arcángel puis la Plaza del Trueque où nous nous arrêtons à la terrasse d’un café pour boire une coup. En fin d’après-midi on reprend Thor et à pein d émarré un policeir minicipal me fait signe, à le voir je le sens mal… Il arrive à ma haauteur et me dit que je suis en infraction car Thor n’aurait jamais du entrer en centre ville. Je lui dit k, où est le panneau d’interdiction ? il me fait signe qu’il est un peu plus loin, Bon je vais aller voir… garez vous-là, je me gare, votre permis, on sort les photocopies de nos passeport et permis de conduite, il tien dans sa main un genre de carnet et me repete qu’il va nous verbaliser, je le vois venir gros comme une maison. je lui dit bon, tu le rédige ton PV ou pas tout en sortant une feulle que j’ai récupéré sur internet du ministère des transports Mexicain à remplir en cas d’infraction. Et regarde le document, ne sait plus trop que faire, il regarde Thor et me parle en rigolant des BreakingDead, j’acquiése en disant que la seule différence c’est que je ne suis pas chimiste et ne fabrique pas de drogue, il rigole, me demande où nous allons, ben Puebla puis il m’indique la route et nous laisse partir. C’est la prepière fois que l’on tombe dans ce genre de situation..\nArrivé à Puebla on se pose sur un parking d’un Soriana et allons faire quelques courses, on trouve de balle baguettes de pain et des croissant et pains au chocolats qui font envie… on goutera le pain ce soir et le reste au petit déj…", 
