        "photo" : false, 
        "wakeUpTemperature" : 17, 
        "comments" : "Ce matin vers 6h30 popo à toussauté et à laché un gros panache de fumée, la vidéo des caméras de surveillance est impressionnante. On ne s’est rabdu compte de rien. On laisse Thor et nous prenons un taxi pour nous conduire dans le centre ville. Notre premier arrêt se fait à l’ex-couvent de Sant Monica qui a été transformé en musée religieux. Ce bel édifice aux façades recouverte de terre cuite et de céramique présente de beau objets et de belles peintures, certaines pièces du couvent ont été recontituées.\nNous poursuivons la visite de la ville, marché, cathédrale, à midi on se fait une petit fantaisie, on mange dans un restaurant atypique : Tacos Arabes Bagdad. On se régale de tacos au Kebab excellent, on a pas trop l’occasion de trouver de l’agneau ici. Dans l’après-midi on poursuit la visite par la Mairie, quelques maisons un peu originales mais rien d’extraordianire et on fini par deux musée, Casa del Dean qui présente deux pièces recouvertes de fresques et la musée Amparo, magnifique, très moderne, qui résente 3000 pièces d’une collection privée, pièces préhispanique, art populaire, photographies de Rodrigo Moya, art contemporain et art Virreinal. Au dernier étage une immense terrasse permet d’observer les toits de la ville qui sont dominés par le clochers, domes de tous les édifices religieux de la ville.\nEn fin de journée on reprend un taxi pour rejoindre le bivouac.", 
