        "distance" : 55598, 
        "distanceTrack" : 0, 
        "walk" : 0, 
        "photo" : false, 
        "wakeUpTemperature" : 23, 
        "comments" : "Ce matin nous faisons la connaissance de nos voisin Allemands de Fribour qui ont remplacé les Brésiliens. Nous discutons un long mement, il parle assez bien le français. Sur les routes depuis plus de 5 ans, il rentre cet été comme nous en Europe pour passer l’été.\nNous faisons les courses pour remplir le frigo puis nous prenons la route direction l’Etat de Verracuz et plus précisément le site Archéologique de El Tajin. Nous prenons l’autopista qui nous améne au travers d’un décor très montagneux et vert en direction du golfe du mexique. Nous décidons de finir les dernier 50 Km par la route en passant par Poza Rica. En pleine ville un Taxi freine brusquement pour décharger un client m,obligeant à freiner sec et on ressent une fraction de seconde plus tard une petit secousse dans Thor, je me suis dit tiens en voilà un qui a été un peu juste, mais sans plus. Un conducteur se porte à mon niveau et me fait comprendre d’aller voir derrière. Effectivement, un taxi m’ait rentré dedans abimant sa calende et son phare gauche tandis qu’un autre Taxi lui ai également rentré dedans.\nThor n’a absoluement rien, j’indique au premier chauffeur que pour moi tout est OK  et que je vais partir et il me dit qu’il a appelé la Police, ils arrivent. Donc on va attendre. 10 mn plus tard un policier arrive seul, il prend la situation en main fait des photos, prend toutes mes coordonnées sur son carnet me demande comment cela c’est produit. Il nous réuni avec les autres conducteurs refait le film, dit que je n’y suis pour rien, me serra la main et me « libere », on peut reprendre la route.\nToiujours en ville je vois des girophares dans mon rétrovieur et le conducteur qui me fait signe de me garer, controle des passeport et permis internationnal, nos copies, il examine longuement, nous demande où nous allons et nous laisse partir. On décide de quitter rapidement cette ville. On arrive finalement sur le parkin du site où nous allons passer la nuit.\nOn est descendu de plus de 2000 mètres et on le sent, il fait très chaud, très lourd.", 
