        "wakeUpTemperature" : 7, 
        "comments" : "Nuit très fraiche, les jours se suivent et ne se ressemblent pas, on est bien à 2500 mètres, on a du ressortir une deuxième couverture et la couette pour arriber à s’endormir. Ce matin inl fait très beau et nous sommes à 09h00 à l’entrée du site, seul… et nous le resterons. Nous faisons un grand tour de ce site absoluement incroyable. On ne comprend pas pourquoi aucun guide n’en parle. Nous sommes  de retour à Thor à 12h30, on mange et nous prenons la route vers Xalapa, la capitale de l’Etat de Veracruz. Nous nous arrêtons au musée archéologique qui est vraiement très beau et présente de très belles pièces.\nNous essayons de regagner notre bivouac mais le GPS nous fais passer dans des rues imossibles. Corinne est encore de corvée pour assurer la circulation et me faire manoeuvrer. Les mexicain sont assez cool, pas un seul coup de xlaxon, ni une insulte mais des sourrires et des saluts. Un jeune en moto voit que je suis en galère, il me demande où je souhaite aller et il nous ouvre la route jusqu’au Walmart. Il sarrête peu avant d’arriver, refuse notre propina, nous sort quelques mots en français et nous souhaite bonne route. Franchement depuis que nous sommes ici nous avons rencontré vraiement des gens adorables.\nUne fois garés, nous faisons nos courses et passons la soirée dans Thor. Très belle journée.", 
