        "wakeUpTemperature" : 32, 
        "comments" : "Nous quitons notre parking direction Veracruz. Il y a des noms comma Veracruz qui font réver, on ne sait pas vraiment pourquoi mais dans l’inconcsient, pour nous, c’est synonime d’une belle ville du golfe du mexique, bref les vacances. Les guides n’en parlent pas plus quye ça, mais on va aller voir de nous même.\nNous avons pas mal de route à faire aujourd’hui et nous décidons de prendre l’autopista. Nous arrivons dans le centre historique et arrivons facilement à nous garer. C’est partie pour une peit tour de ville, son zocalo, sa mairie, le prot puis le malecon où nous pouvons voir le bateauy école de la marine nationale du mexique. A misi on mange dans un très bon restaurant près de la cathédrale où je oprend un filet de poisson à la veracruzienne, excellent. Un peu décu par cerre ville.\nNous reprenons la route en mileu d’après midi et quittons cette partie du Mexique pour nous rendre dans l’Oaxaca, toujouts par l’autopista. Nous sortons au niveau de Ciudad Mendoza où on tombe encore sur un policier minicipal qui veut nous verbaliser. Il est rejoint par un autre policier qui parle un peu anglais, car dans ces cas là mon espagnol est inexistant. Pour le faire court je refuse l’arrangement et damnde a être verbalisé, on baisse le prix je refuse toujours et attend mon amende et cela fini par « Sorry » puis bonne route… Nous nous arrêtons pour la nuit à Téhuacan sur le parking d’un Walmart.", 
