        "walk" : 11000, 
        "photo" : false, 
        "wakeUpTemperature" : 15, 
        "comments" : "Ca matin départ pour le site de Monte Alban qui est tout proche. On y passe la matinée, le site est vraiment très beau, construit sur un éperon rocheux il dommine toute la ville et la vallée.\nEnsuite nous partons pour le centre ville de Oaxaca. C’est samedi, il y a des marchés de partout, circuler est vraiment compliqué. On décide d’aller directement sur notre bivouac et de la nous prenons un taxi, c’est plus sur.\nArrivés sur le Zocalo nous promenons dans le centre historique, mangeons la spécialité d’ici un tacos de 30 cm de diamètre cuit au feu de bois, du coup il est très foncé presque noir, garni de plein de bonne choses. Arrivé sur la place du Templo de Santo Domingo nous assistons à la sortie de l’eglise d’un mariage traditionnel avec musique danseur et toutes les femmes en habits traditionnels, brodés de fleurs, c’est très coloré. Nous visitons le centre culturel qui est situé dans l’ancien couvent Santo Domingo. On peut notamment y voir les objets découverts dans la tombe N°7 à Monte Alban, avec chose rarissime ici, des objets en or. Il ya également un carne en partie recouvert de petit bout de fayences turquoise. Très belle visite. Nous visitons également la maison Cortes qui a été transformé en Musée d’Art contemporain, moyen. Nous finissons à la Cathédrale, le Zocalo et enfin les marchés qui sont bondés, beaucoup de restaurants, certains n’hésite par à faire des BBC ce qui enfule toutes les allées. Les odeurs évoluent en fonction des étals, Boeufs, poulets, insectes, crevettes… bien sur tout ca posé à même l’étal sans aucun systéme de référgiration…\nEn fin de journée on reprend un taxi? faisons quelques courses au Soriana et nous posons dans Thor.. épuisés, il faut dire qu’il fait très chaud, plus de 30°, vivement cette nuit…", 
