        "comments" : "Ce matin c’est le réveil quinnous sort des bras de morphé, une fois n’est pas coutume. On veut profiter du fait d’être dans le site pour pouvoir en bénéficier avant l’arrivée des touriste à 08h00. \nVers 10h00 on quitte les lieux, on passe à Mitla retirer du cash et nous prenons la route en direction du Chiapas.\nCe sont plus de 200 kilomètre de montagne, très belles. On passe à Santiago Matatlan qui s’est proclamée Capitale Mondiale du mezcal (Expliquer la différence avec la Tequila) D’ailleur l’Oaxaca est vraiment le pays du Mezcal on voit de très nombreux champs d’Agaves, plus que dans la région de Tequila. Il ya de très nombreux petit producteurs qui meule l’agave cuite encore avec de meule en pierre actionnée par un cheval.\nAu debut nous avions envisagé de nous poser pour la nuit au bord du Pacifique du côté de Salina Cruz, mais finalement on poursuit notre route en direction de Tuxtla Gutiérrez et on fait halte en route dans un Hôtel qui acceuille les RV.", 
