        "wakeUpTemperature" : 28, 
        "comments" : "Nuit chaude et bruyante. Ce matin on traine un peu car nous souhaiterions faire un tour de bateau pour admirer le canyon avec ses falaises hautes de 1000 mètres et la meilleure heure pour y aller est entre 11 et 14 heures pour avoir le soleil au zenith. Mais comme hier, nous sommes enveloppé d’une brume de chaleur, la visibilité est vraiment très mauvaise. En fin de matinée aucun changement et la météo annonce de la pluie pour cet après-midi. On décide donc de quitter la ville et de faire route sur San Cristóbal de Las Casas. Une fois arrivée on cherche une laverie atomatique mais on ne trouve qu’une laverie où il faut laisser son linge et le récupérer lus tard. Corinne est un peu contrarié mais on n’a pas le choix. On doit revenir à 20 heures pour le récupérer. Nous partons ensuite en ville et trouvons un grand parking où laisser Thor. Nous prenons ensuite un Taxi qui nous conduit au centre. On mange dans un petit resto au bord d’une place où le serveur se fait un honneur de nous sortir tous les mots français qu’il connait. Corinne prend du beauf panné avec riz, salade et purée de haricot rouge et moi poulet et steack avec le même accompgnement plus deux boissons … 7$. Nous allons à la Bibliothèque pour passer la journée qui s’annonce pluvieuse. Comme d’habitude nous somme très bien accueilli. On s’installe et le Wifi n’est pas trop mauvais. Vers 19h30 on quitte le centre et nous allons récupérer notre linge, bien propre, bien rangé dans des petit sac. Nous finisson sur le parkin d’un Chedraoui pour passer la nuit.", 
