        "wakeUpTemperature" : 24, 
        "comments" : "Ce matin nous quitons le magnifique lac de Tziscao après avoir fait le plein d'eau non potable. Nous reprenons la route de montagne qui traverse uen forêt tropicale. Nous arrivons jusqu'au village de Jérusalén puis empruntons une piste sur 11 Km qui un tiers de temps est cimenter pour arriver aux cascades Las Nubes. 4 Km avant d’arriver nous tombons sur un barrage, unr grosses corde tirée en travers de la route et on nous demande 100 pesos pour passer. On nous remet un ticket « officiel » de la mairie du coin, certainement pour financer une route ou autre chose… Nous arrivons au camping et passons juste entre deux rochers, Corinne me fait manoauvrer parfaitement.\nOn passe l’après-midi entre balade et baignade dans une eau très fraiche qui fait du bien. Nous sommes bien descendus depuis hiers et les température sont très chaude. A côté de l’endroit ou nous nous sommes stationné se trouve un stand de bouffe. En fin d’après-midi le monsieur vient vers nous avec un verre plein d’une boisson locale, Cacao plus farine de maïs. Ce n’est pas très bon même si on sent bien le gout du chocolat. On les remercie bien et nous commençons à discuter chocolat, du coup il nous donne une ???? de chocolat qui pousse ici. En fin de journée je vais à l’acceuil pour me brancher et me connecter à Internet pour envoyer mes photos. ", 
