        "note" : "3", 
        "distance" : 57011, 
        "distanceTrack" : 0, 
        "walk" : 2000, 
        "photo" : false, 
        "wakeUpTemperature" : 24, 
        "comments" : "Ce matin on quitte le camping de bonne heure car nous aimerions arriver à notre destination du jour avant midi. On arrive a ressortir du camping indemne et arrivons rapidement sur la route 307 qui longe la frontière avec le Guatemala. La route devient vite catstrophique avec de trous, des affaissement de terrain, dès fois d’un bon mètre, sans parler des fois où il n’y a plus de route carément. Il faut être hyper prudent et malgrés cela on se fait secouer quelquefois. A partir de Benemérito de las Américas, la route s’amèliore un peu. Au final nous mettons plus de 6 heures pour faire les 250 kilomètres de l’étape du jour. De nombreux check point de l’armée sont présents sur la route mais aucun ne nous contrôle. Nous traverssons un décor magnifique de forêt tropicale qui nous rapelle la Guadeloupe. En traversant un hameau on voit au milieu de la route un gamin de 7, 8 en train de mettre du gravier dans le trous, on a pas pu s’empêcher de lui donner la pièce, même si la pluspart du temps on refuse. Sur la route on peut observer de nombreux champs de palmiers pour l’huile de palme, Les paquets de graines sont déposés au bord de la route et des camiuons viennet les chercher. Espérons qu’ils ne rasent pas toute la jungle pour y planter ces palmiers…\nA notre arrivée on se fait «racketer» de 60 pesos pour avoir le droit de renter dans la ville…\nOn arrive au niveau de l’embarcadère et il est trop tard pour faire l’escursion aujourd’hui, on prend tout les renseignements pour demain matin.\nUn fois Thor garé on fait un tour le long de la rivière où toutes les barques sont rangées. Sous un carbet on voit une petite fille dormir du sommeil du juste sur une étagère d’un petit meuble, trop mignone. Près de là dans un grand arbre se trouve une dizaine de singe atèle ou sing araigné, certains sont affalés sur une branche en mode panthère noire, d’autre s’amuse et mange. C’est là que nous rencontrons un couple, Julie et Jean-Davis de Toulouse en vancances pour 3 semaines au Mexique. On discute un long moment, ils préparent eux aussi un voyage d’un an en Afrique à bord d’un 4x4 aménagé.\nEn fin d’après-midi, on entend des singes hurleurs crier dans la forêt. Difficile de dire où ils sont exactement tant leur cris et fort et porte loin.\nIl fait très chaud et très lourd, il fait 40° dans Thor, la nuit va être longue.", 
