        "photo" : false, 
        "wakeUpTemperature" : 24, 
        "comments" : "Nuit très chaude dans Thor, On a mis le reveil de bonne heure pour être à 7h00 au guichet. Les singes hurleurs son également debout de bonne heure et le font savoir. Nous retrouvons les Toulousains qui ont dormi à l’hôtel. Une fois les billets pris pour l’entrée du site de Yaxchilan, nous nous mettons en quête d’un bateau, une « lancha », pour nous y conduire. Le site n’est accésible que par le Rio Usumacinta qui est la frontière naturelle entre le Mexique et le Guatemala. Sur le chemin de nombreux bateleurs nous annonce les prix, mais nous preférons aller j’usqu’à l’embarcadère. Nous y retrouvons une famille de Hollandais, ils sont 6 et nous 4 le bateau est complet, le pilote nous fait un bon prix.\nAprès 45 minutes de navigation sur cette rivière qui coupe en deux la jungle, en route nous croisons quelques crocodiles qui nous regardent passer du bord de la berge. Nous arrivons sur le site Maya. Un long escalier et nous y sommes. Le temps est très lourd, une brume entoure les arbre, l’ambiance est très spéciale. De nombreux singes atéles sont dans les arbres, des singes hurleurs assurent le bruit de fond. Il faut bien 2 heures pour visiter tout les sites qui se décomposent en plusieurs parties. Les édifices sont particuliers, finalement aucun n’est le même. A l’intérieur des galeries nous derangeons de nombreuses petites chauve-souris. Après la visite nous remontons dans notre lancha pour une de navigation à contre courant d’une heure. Si nous étions les seuls visiteurs sur le site, au cours du chemin retour nous croisons des dizaines de bateaux qui conduisent les touristes certainement arrivés de Palenqué.\nNous quittons Julie et Jean-David et reprenons la route en direction du site de Bonampak. La aussi on doit s’acquiter de la somme de 60 pesos pour la ville ce qui me gonfle un peu. Après quelques kilomètres, on doit laisser Thor et prendre un Taxi qui nous conduira à l’entrée du site. Le gars nous demande 400 pesos, on refuse et on fait demi tour. Faut pas exagèrer.\nOn reprend la route et filons en direction de Agua Azul. La route est toujours aussi rock’n’roll. On arrive en fin d’après-midi et on se pose sur le parking pour la nuit. On fait un petit tour du site qui est magnifique et blindé de personnes.", 
