        "walk" : 0, 
        "photo" : false, 
        "wakeUpTemperature" : 27, 
        "comments" : "Ce matin on quitte le camping le plus tard possible pour profiter au max de la Clim. Avoir de partir on fait in petit complément d’eau. Nous partons que pour quelques kilomètres en direction de deux cenotes Keken et Samula.\nSur place on décide de prendre également le repas proposé dans un restaurant Maya du site. Je commence mar le cenote « cave » Keken qui est vraiment magnifique avec ces stalagtites qui descendent dan l’eau et ce magnifique trou de lumière, je ne me sens pas encore de plonger dans de l’eau froide et ce malgrè la chaleur, je mabstient donc… De retour je récuoère Corinne et nous allos au restaurant où il fait bien frais. Le repas coute 110 pesos/Pers et se compose d’une soupe, d’une entrée, d’un plat, d’un dessert et d’une boisson. On prens donc une soupe de lime, puis le garçon nous porpose une assiette pour deux avec un échantillon de chaque plat puis nous prenons un plat de porc et en dessert une sorte de riz au lait et du pain perdu. Le tout accompaagné de Jamaica. On c’est réaglé, aussi bien au niveau de la présentation que des saveurs. Après le repas je fait un tour à la cenote « cave » Samula qui est beaucoup moins beau à mon avis.\nOn reste ensuite un peu sur le parking dans Thor, on laisse passer le plus gros de chaleur et en fin d’après-midi on part en direction de Coba qui sera notre dernier site que nous visiterons. Une fois sur place on se pose sur le parking du site pour la nuit, la visite se fera demain matin dès l’ouverture… à la fraiche.", 
