        "comments" : "14 : Ce matin nous sommes à 8 heures devant l’entrée du site.Il ya déjà pal mal de monde mais ciomme le site est immense cela ne pose pas de problème. Il y aurai plus de 600 édifices à Coba, nous n’en faisons qu’une infime partie mais comme les distance sont assez grandes entre chaque groupe, il faut louer un vélo ou prendre comme nous un genre de pous pouss. Du coup on se fait les 10 km de chemin qui traverse la jungle à la fraiche et sans efforts. Nous y voyons de nombreuses steles assez abimées et finissons par la grande pyramide qui monte à 42 mètres de hauteurs. D’en haut nous avons une vue sur toute la péninsule qui est relativement plate. De retour à Thor nous prenons la route direction le camping ou Thor va pouvoir se reposer quelques mois. Il est tenu par un couple d’américain et il est très bien équipé.\n\n15 : ce matin on traine un peu et vers 11h00 on prend la petite chevrolet que le camping propose à la location pour aller faire un tour dans Cancun qui présente en fait que très peu d’intérêt. On comence par un arrêt à The home Depot pour acheter des systèmes deshumidificateurs pour Thor puis nous passons sur la lagune et ces 25 km d’hôtels, nous mangeons au bord de la mer puis faisons retour au camping. De retour je me fais arrêter par un flic pour exécs de vitesse…\n\n16 : préparation de Thor, dernières lessives et repos.\n\n17 : ce matin on vide et on nettoie les rréservoir de thor, on coupe l’electrcit é et le propane, on le mene jusqu’à sa place au sttorage, on dospose les bas antihumidité et à l’abamdonne… Le patrons du camping, nous conduit jusqu’’à l’aéroport où un mong voyage nous attend \n\n", 
